import React from 'react';
import './Column.css';

const Column = (props)=>{
    return(
        <div className="Col">
            <img className={props.size} src={props.url} alt={props.name} />
            <h2 className="Title">I am a {props.name}</h2>
        </div>

    );
}

export default Column;
